import React from 'react';

import PDPProduct from './PDPProduct';

const ProductDisplayPage = (props) => {
    return (
      <div>
        {props.products.map((product) => (
          <>
          <PDPProduct
            id={product.id}
            sku={product.sku}
            title={product.title}
            image={product.image}
            price={product.price}
            msrp={product.msrp}
            url={product.url}
          />
          </>
        ))}
      </div>
    );
  };

  export default ProductDisplayPage;
